import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp, faGithub } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope, faHouse } from '@fortawesome/free-solid-svg-icons';
import '../Css/Skillsaya.css';
import Skillsaya from '../Assets/Skillsaya.png';



const Header = () => {

  return (
    <div className="skillsaya">
        <Container>
            <Row className=''>
                <Col>
                    <h1><span className='text-yellow'>
                    Skill</span> Saya</h1>

                    <Row>
                        <Col xs={4}>
                        <div className='button-skill'>
                        <p className='text-purple'>HTML</p>
                    </div>
                        </Col>
                    </Row>

                </Col>
                <Col>
                    <img className='Skillsaya' src={Skillsaya} alt="Skillsaya" />
                </Col>
            </Row>
        </Container>
    </div>
  );
}

export default Header;
